import React from 'react';
import {View,Text} from 'react-native';


const MainApp = () => {
    return(
        <View style={{
            flex:1,
            alignItems:'center',
            justifyContent:'center'
        }}>
            <Text>MainApp Screen</Text>
        </View>
    )
}
export default MainApp;
